import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Table = () => {
  const [data, setData] = useState([{
    "Message":" ","Type":"","Query":"","Name":""
  }]);
  
  useEffect(()=>{
    const resp = axios.get("http://localhost:3001/0").then((resp)=>{
        setData(resp.data)
        console.log(data);
    })
  },[])

  return (
    <div>
      <h2>Data Table</h2>
      <table>
        <thead>
          <tr>
            <th>Message</th>
            <th>Name</th>
            <th>Query</th>
            <th>Type</th>
          </tr>
        </thead>
        <tbody>
            {data.map((d)=>{
                console.log(d);
            })}
        </tbody>
      </table>
    </div>
  );
};

export default Table;
